import React from 'react'

export default function ProductsList() {
    let productList = [
        {
            id: 1,
            name: "Product A",
            price: 29.99,
            image: "imageA.jpg",
            description: "Description for Product A."
        },
        {
            id: 2,
            name: "Product B",
            price: 49.99,
            image: "imageB.jpg",
            description: "Description for Product B."
        },
        {
            id: 3,
            name: "Product C",
            price: 19.99,
            image: "imageC.jpg",
            description: "Description for Product C."
        },
        {
            id: 4,
            name: "Product D",
            price: 99.99,
            image: "imageD.jpg",
            description: "Description for Product D."
        },
        {
            id: 5,
            name: "Product E",
            price: 39.99,
            image: "imageE.jpg",
            description: "Description for Product E."
        },
        {
            id: 6,
            name: "Product F",
            price: 59.99,
            image: "imageF.jpg",
            description: "Description for Product F."
        },
        {
            id: 7,
            name: "Product G",
            price: 89.99,
            image: "imageG.jpg",
            description: "Description for Product G."
        },
        {
            id: 8,
            name: "Product H",
            price: 15.99,
            image: "imageH.jpg",
            description: "Description for Product H."
        },
        {
            id: 9,
            name: "Product I",
            price: 25.99,
            image: "imageI.jpg",
            description: "Description for Product I."
        },
        {
            id: 10,
            name: "Product J",
            price: 75.99,
            image: "imageJ.jpg",
            description: "Description for Product J."
        }
    ];
  return (
    <div>
      <h1>testing</h1>

      <div>{
      productList.map(product=>(
                <div>
                    {product.name}<br/>
                    {product.price}<br/>
                    {product.image}<br/>
                    {product.description}<br/>
                </div>
            ))
    }    
        </div>
    </div>
  )
}
